import React from "react";
import styled from "styled-components";
import LoginForm from "./LoginForm";

function LoginCard() {
  return (
    <CardContainer>
      <FormColumn>
        <LoginForm />
      </FormColumn>
      <ImageColumn>
        <WildlifeImage loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/cce93baded15cf78beafdae5e82e359b245c19b27d59da6ad1ee73fc4f71def7?apiKey=e3765372b84f44f7af794f9207eac8b0&" alt="Wildlife" />
      </ImageColumn>
    </CardContainer>
  );
}

const CardContainer = styled.div`
  display: flex;
  background-color: #ffffff;
  border-radius: 12px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  overflow: hidden;
  width: 100%;
  max-width: 1000px;
  @media (max-width: 991px) {
    flex-direction: column;
  }
`;

const FormColumn = styled.div`
  flex: 1;
  padding: 40px;
  @media (max-width: 991px) {
    padding: 20px;
  }
`;

const ImageColumn = styled.div`
  flex: 1;
  @media (max-width: 991px) {
    order: -1;
  }
`;

const WildlifeImage = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

export default LoginCard;
